#include <time.h>
#include <sys/timeb.h>
int get_time(string r)
{
    struct timeb rawtime;
    ftime(&rawtime);
    static int ms = rawtime.millitm;
    static unsigned long s = rawtime.time;
    int out_ms = rawtime.millitm - ms;
    unsigned long out_s = rawtime.time - s;
    if (out_ms < 0)
    {
        out_ms += 1000;
        out_s -= 1;
    }
    ms = rawtime.millitm;
    s = rawtime.time;
    int total = 1000*out_s+out_ms;
    cout<<r<<": "<<total<<"ms"<<endl;
    return total;
}
class Solution {
public:
    int strStr(string haystack, string needle) {
        int n=haystack.size(),m=needle.size();
        if(n<m)return -1;
        if(m==0){
            if(n==0)return 0;
            else return -1;
        }
        for(int i=0;i<n;++i){
            int flag =0;
            for(int j=i;j<m;++j)
                if(needle[j]!=haystack[i]){
                    flag =1;break;
                }
            if(flag==0)return i;
        }
        return -1;
    }
};

int main()
{
	system("mode con:cols=100 lines=9000");
	Solution s;
	string sn,sm;
	fstream f("123.txt");
	getline(f,sn);
	getline(f,sm);
	f.close();
	get_time("begin");
	cout<<s.strStr(sn,sm)<<endl;
	get_time("end");
     return 0;
}
